import React from 'react'
import { Link,Outlet } from 'react-router-dom'
export default function Admin() {
  return (
    <div>
     <Link to={"/admin/profiles"} style={{marginRight:"10px"}}>Profiles</Link>

<Link to={"/admin/quantity"}  style={{marginRight:"10px"}}>Quantity</Link>

<Link to={"/admin/source"}  style={{marginRight:"10px"}}>Source</Link>
<Outlet/>
    </div>
  )
}
